window.bookSummaryJSON = "<p><b>The apocalypse began on Bring Your Dog to Work Day.</b></p> <p>One moment, everything was normal. Then the World Core woke up, and slaughtered almost everything alive so it could harvest their Chi.</p> <p>After that, it rebuilt everything and put the survivors in a game-like environment, pitting them against monsters and each other.</p> <p>The rules are different now. Chi power is as important as being able to fight.</p> <p>I'm one of the survivors. With my knowledge of martial arts and my special Chi skill, I'm turning myself into a force to be reckoned with.</p> <p><b>This is a Western cultivation fantasy adventure. It includes a definite sense of progression, an MC who isn't an idiot, and Gamelit/LitRPG elements.</b> </p>"; 
